const rounds = [
    {
        title: 'ThreeBoulderOnsight',
        data: {
            numBoulders: 3,
            activeTime: 4,
            restTime: 4,
        },
    },
    {
        title: 'FourBoulderOnsight',
        data: {
            numBoulders: 4,
            activeTime: 4,
            restTime: 4,
        },
    },
    {
        title: 'FiveBoulderOnsight',
        data: {
            numBoulders: 5,
            activeTime: 4,
            restTime: 4,
        },
    },
    {
        title: 'SixBoulderOnsight',
        data: {
            numBoulders: 6,
            activeTime: 4,
            restTime: 4,
        },
    }
]

export default function getRound(title) {
    rounds.map(round => {
        if(round.title == title) {
            return round
        }
    })
}
